import React, { useState, useRef, useEffect } from 'react';
import styled from 'styled-components';
import { useTasks } from '../hooks/useTasks';

const FormContainer = styled.div`
  background: white;
  border-radius: 6px;
  padding: 12px;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.15);
  border: 2px solid #3498db;
`;

const FormInput = styled.input`
  width: 100%;
  border: 2px solid #e9ecef;
  border-radius: 4px;
  padding: 8px 10px;
  font-size: 14px;
  font-weight: 500;
  outline: none;
  margin-bottom: 8px;

  &:focus {
    border-color: #3498db;
    box-shadow: 0 0 0 2px rgba(52, 152, 219, 0.2);
  }

  &::placeholder {
    color: #adb5bd;
  }
`;

const FormTextarea = styled.textarea`
  width: 100%;
  border: 2px solid #e9ecef;
  border-radius: 4px;
  padding: 8px 10px;
  font-size: 12px;
  outline: none;
  resize: vertical;
  min-height: 60px;
  margin-bottom: 12px;
  font-family: inherit;

  &:focus {
    border-color: #3498db;
    box-shadow: 0 0 0 2px rgba(52, 152, 219, 0.2);
  }

  &::placeholder {
    color: #adb5bd;
  }
`;

const FormActions = styled.div`
  display: flex;
  gap: 8px;
  justify-content: flex-end;
`;

const ActionButton = styled.button`
  background: ${props => props.primary ? '#3498db' : '#6c757d'};
  color: white;
  border: none;
  border-radius: 4px;
  padding: 8px 16px;
  font-size: 12px;
  font-weight: 500;
  cursor: pointer;
  transition: all 0.2s;
  display: flex;
  align-items: center;
  gap: 6px;

  &:hover:not(:disabled) {
    background: ${props => props.primary ? '#2980b9' : '#5a6268'};
    transform: translateY(-1px);
  }

  &:disabled {
    opacity: 0.6;
    cursor: not-allowed;
    transform: none;
  }

  &:active:not(:disabled) {
    transform: translateY(0);
  }
`;

const ErrorMessage = styled.div`
  color: #e74c3c;
  font-size: 11px;
  margin-top: 4px;
  margin-bottom: 8px;
  padding: 6px 8px;
  background: rgba(231, 76, 60, 0.1);
  border-radius: 4px;
  border-left: 3px solid #e74c3c;
`;

function AddCardForm({ listId, boardId, onCancel, onSuccess }) {
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [error, setError] = useState('');

  const { createTask, loading } = useTasks();
  const titleInputRef = useRef(null);

  // Focus on title input when component mounts
  useEffect(() => {
    if (titleInputRef.current) {
      titleInputRef.current.focus();
    }
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!title.trim()) {
      setError('Card title is required');
      return;
    }

    setError('');

    try {
      await createTask({
        boardId,
        listId,
        name: title.trim(),
        desc: description.trim()
      });

      // Reset form
      setTitle('');
      setDescription('');

      // Call success callback
      if (onSuccess) {
        onSuccess();
      }
    } catch (err) {
      setError(err.message || 'Failed to create card');
    }
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Enter' && e.ctrlKey) {
      handleSubmit(e);
    } else if (e.key === 'Escape') {
      onCancel();
    }
  };

  return (
    <FormContainer>
      <form onSubmit={handleSubmit}>
        <FormInput
          ref={titleInputRef}
          type="text"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          onKeyDown={handleKeyDown}
          placeholder="Enter card title..."
          disabled={loading}
          maxLength={500}
        />

        <FormTextarea
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          onKeyDown={handleKeyDown}
          placeholder="Add a description (optional)..."
          disabled={loading}
          maxLength={16384}
        />

        {error && (
          <ErrorMessage>{error}</ErrorMessage>
        )}

        <FormActions>
          <ActionButton 
            type="button" 
            onClick={onCancel}
            disabled={loading}
          >
            Cancel
          </ActionButton>

          <ActionButton 
            type="submit" 
            primary
            disabled={loading || !title.trim()}
          >
            {loading ? (
              <>
                <span>⏳</span>
                Adding...
              </>
            ) : (
              <>
                <span>➕</span>
                Add Card
              </>
            )}
          </ActionButton>
        </FormActions>
      </form>

      <div style={{ fontSize: '10px', color: '#6c757d', marginTop: '8px', textAlign: 'center' }}>
        Press Ctrl+Enter to submit, Esc to cancel
      </div>
    </FormContainer>
  );
}

export default AddCardForm;
